// src/user/UserContact.js
import React from 'react';
import './UserContact.css';

const UserContact = () => {
  return (
    <div className="user-contact-container">
      <h2>Contact Us</h2>
      <form>
        <div>
          <label>Name</label>
          <input type="text" />
        </div>
        <div>
          <label>Email</label>
          <input type="email" />
        </div>
        <div>
          <label>Message</label>
          <textarea></textarea>
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default UserContact;
